package com.example.demo.domain;

import java.util.Date;

public class User{ 	 private Integer id; 	 private String name; 	 private String addr; 	 private String phone; 	 private Date createTime; 	 private Date updateTime; 	 private Integer deleted; 	 private String idCard; 	 private Integer areaId; 	 public User() {
 	 	 super();	}
 	 public void setId(Integer id){ 		 this.id=id; 	 } 	 public Integer getId(){ 		 return this.id; 	 } 	 public void setName(String name){ 		 this.name=name; 	 } 	 public String getName(){ 		 return this.name; 	 } 	 public void setAddr(String addr){ 		 this.addr=addr; 	 } 	 public String getAddr(){ 		 return this.addr; 	 } 	 public void setPhone(String phone){ 		 this.phone=phone; 	 } 	 public String getPhone(){ 		 return this.phone; 	 } 	 public void setCreateTime(Date createTime){ 		 this.createTime=createTime; 	 } 	 public Date getCreateTime(){ 		 return this.createTime; 	 } 	 public void setUpdateTime(Date updateTime){ 		 this.updateTime=updateTime; 	 } 	 public Date getUpdateTime(){ 		 return this.updateTime; 	 } 	 public void setDeleted(Integer deleted){ 		 this.deleted=deleted; 	 } 	 public Integer getDeleted(){ 		 return this.deleted; 	 } 	 public void setIdCard(String idCard){ 		 this.idCard=idCard; 	 } 	 public String getIdCard(){ 		 return this.idCard; 	 } 	 public void setAreaId(Integer areaId){ 		 this.areaId=areaId; 	 } 	 public Integer getAreaId(){ 		 return this.areaId; 	 }
}